import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login'; // Adjust if necessary
import Apply from './components/Application';   // Adjust if necessary
import Review from './components/Review'; 
import Register from './components/Register';// Import the Review component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/apply" element={<Apply />} />
        <Route path="/review" element={<Review />} />
        <Route path="/register" element={<Register />} />
         {/* Add the Review route */}
      </Routes>
    </Router>
  );
}

export default App;
